$('.form__submit').click(function () {
    var form = $(this).parents('.form');
    var formAttr = $(this).parents('.form').attr("data-form");
    form.addClass(formAttr);

    var formClass = '.' + formAttr;
    var input = $(formClass + ' ' + '.form_required');
    var btn = $(formClass + ' ' + '.form__submit');

    var flag = true;

    input.each(function (i) {
        if (this.value == '') {
            $(this).parents('.form__group').addClass('validation-error');
            flag = false;
        } else {
            $(this).parents('.form__group').removeClass('validation-error');
        }
    });

    if (!flag) {
        btn.attr('disabled', 'disabled');
    }
    if (flag) {
        btn.attr('disabled', false);
        form.addClass('form_valid');
    }

    input.change(function () {
        $(this).parents('.form__group').removeClass('validation-error');
        $(this).parents('.form__group').removeClass('group-validation');

        if ($(formClass + ' ' + '.form__group').hasClass("group-validation")) {
            btn.attr('disabled', 'disabled');
        } else {
            btn.attr('disabled', false);
            form.addClass('form_valid');
        }
    });
});


// Focus

$('.form__control').on('focus', function () {
    $(this).parents('.form__group').addClass('focus')
});

$('.form__control').on('blur', function () {
    if (this.value.length === 0) {
        $(this).parents('.form__group').removeClass('focus')
    }
});


// Password

$('body').on('click', '.password-visibility', function () {
    var passwordId = $(this).attr('data-id');
    if ($(".password[data-id='" + passwordId + "']").attr('type') == 'password') {
        $(this).addClass('view');
        $(".password[data-id='" + passwordId + "']").attr('type', 'text');
    } else {
        $(this).removeClass('view');
        $(".password[data-id='" + passwordId + "']").attr('type', 'password');
    }
    return false;
});


// Copy Txt

$(document).ready(function () {
    $('.copy__btn').click(function () {
        var copyId = $(this).attr('data-id');
        var $temp = $("<input>");
        $("body").append($temp);
        $temp.val($('#' + copyId + '').text()).select();
        $('#' + copyId + '').css('background', 'rgb(226 229 236 / 90%)');

        function cbg() {
            $('#' + copyId + '').css('background', 'rgb(226 229 236 / 0%)');
        }
        setTimeout(cbg, 1200);

        document.execCommand("copy");
        $temp.remove();
    });
});

$(document).ready(function() {
    // Копирование текста из модального окна
    $('.copy__btn').on('click', function() {
        var blockId = $(this).data('id');
        var blockText = $('[data-id="' + blockId + '"]').text();

        // Используем Clipboard API для копирования текста
        navigator.clipboard.writeText(blockText).then(function() {}).catch(function(err) {});
    });
});

// File

const uploadInput = document.querySelector(".upload__input");

if (uploadInput) {
    uploadInput.addEventListener("change", (e) => {
        const [file] = e.target.files;
        const { name: fileName, size } = file;
        const fileSize = (size / 1024).toFixed(2);
        const fileNameAndSize = `${fileName}, ${fileSize} K`;
        const image = document.querySelector('.upload__img img');
        image.src = URL.createObjectURL(file);
        //document.querySelector(".upload__info").textContent = fileNameAndSize;
    });
}








